class Prices extends React.Component {
    state = {
        currency : 'USD'
    }

    render() {
        console.log(this.props)
        return (
            <div>
                <ul className="list-group">
                    <li className="list-group-itme">
                        Bitcoin rate for {this.props.bpi.bpi} :
                        <span className="badge badge-primary">
                            {this.props.bpi.bpi}
                        </span>
                    </li>
                </ul>
            </div>
        )
    }
}

export default Prices
